{"cells":[{"source":"<a href=\"https://www.kaggle.com/aaronzaidman/google-capstone-project-case-study?scriptVersionId=88583074\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"ae10e28f","metadata":{"_cell_guid":"46503a3c-76f0-43ed-9b36-987be6f78b78","_uuid":"ec24c1be-5069-4613-9164-9143a87464a0","papermill":{"duration":0.256546,"end_time":"2022-02-23T17:30:50.335519","exception":false,"start_time":"2022-02-23T17:30:50.078973","status":"completed"},"tags":[]},"source":["# Introduction\n","In this exploratory case study, I am a junior data analyst for [Bellabeat](https://bellabeat.com/), a high-tech company that manufactures health-focused smart products.  \n","\n","I have been given [Fitbit Fitness Tracker Data](https://www.kaggle.com/arashnic/fitbit) through Kaggle to analyze smart device usage, and apply those insights to a Bellabeat product.  My project is guided by these questions: \n","1. What are some trends in smart device usage?\n","2. How could these trends apply to Bellabeat customers?\n","3. How could these trends help influence Bellabeat marketing strategy?"]},{"cell_type":"markdown","id":"0c7e6ad3","metadata":{"_cell_guid":"57d4caa9-dda8-4f3c-8e32-5ac3fae0f6c0","_uuid":"631ae762-c635-4937-b744-a8cd49c18f55","papermill":{"duration":0.252039,"end_time":"2022-02-23T17:30:50.843312","exception":false,"start_time":"2022-02-23T17:30:50.591273","status":"completed"},"tags":[]},"source":["# Data Summary\n","From the Kaggle source page, the dataset was generated by respondents through a survey between 3/12/2016 - 5/12/2016.  Thirty fitbit users consented to the submission of their personal data, \"including minute-level output for physical activity, heart rate, and sleep monitoring.\"\n","\n","The data has multiple tables, including information on sleep times, steps, distances, calorie outputs, and more. I found metadata through a Google search to help clarify some acronyms in the column headers and make sense of the data. The data dictionary for fitbit can be found [here](https://www.fitabase.com/resources/knowledge-base/exporting-data/data-dictionaries/).\n","\n","The data has an open and public free use creative license. It should be noted the data is from 2016 and may have lost some relevancy. Also the data is not gender specific, but the analysis is for a women centered smart device app."]},{"cell_type":"markdown","id":"f471ec47","metadata":{"_cell_guid":"bd4aeaf7-0b5c-43ca-8917-b7b7fda65edb","_uuid":"07ee6be3-42a2-46ca-8102-93f9fe1af910","papermill":{"duration":0.255318,"end_time":"2022-02-23T17:30:51.354373","exception":false,"start_time":"2022-02-23T17:30:51.099055","status":"completed"},"tags":[]},"source":["# Check Integrity\n","Many tables within the dataset are merged or calculated from other tables, which has questionable integrity and reliability.  If this task is done poorly, then the data is compromised and unusable. \n","\n","To check the integrity, I will create a table for hourly data from a minute based table, and then compare the new calculated table against the given table.  For the context of the case study, it is safe to assume if this can be trusted, then the rest of the data can also be trusted."]},{"cell_type":"code","execution_count":1,"id":"91d7d7d1","metadata":{"_cell_guid":"335701f0-2fb9-481c-903f-e665f8371260","_kg_hide-output":true,"_uuid":"8e010593-ff03-4dfe-8437-6fc6e37a9818","collapsed":false,"execution":{"iopub.execute_input":"2022-02-23T17:30:51.879888Z","iopub.status.busy":"2022-02-23T17:30:51.876506Z","iopub.status.idle":"2022-02-23T17:30:53.327398Z","shell.execute_reply":"2022-02-23T17:30:53.326212Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":1.713167,"end_time":"2022-02-23T17:30:53.327584","exception":false,"start_time":"2022-02-23T17:30:51.614417","status":"completed"},"