completed"},"tags":[]},"source":["Both datasets have three columns:\n","* user id \n","* activity time\n","* calories\n","\n","From here, I need to lightly clean the columns by making the id factors and dates proper date formats.  This will make our next tasks tidyer."]},{"cell_type":"code","execution_count":4,"id":"f8990211","metadata":{"_cell_guid":"37409de6-b54d-4113-a631-32fbb3d0bbea","_uuid":"22bf646d-4c32-4354-a91c-e1c31eae6e4b","collapsed":false,"execution":{"iopub.execute_input":"2022-02-23T17:30:56.284224Z","iopub.status.busy":"2022-02-23T17:30:56.282401Z","iopub.status.idle":"2022-02-23T17:31:00.732792Z","shell.execute_reply":"2022-02-23T17:31:00.731011Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":4.724309,"end_time":"2022-02-23T17:31:00.733007","exception":false,"start_time":"2022-02-23T17:30:56.008698","status":"completed"},"tags":[]},"outputs":[],"source":["min_cals <- min_cals %>%\n","  mutate(ActivityMinute = mdy_hms(ActivityMinute), Id = as.factor(Id)) %>% clean_names()\n","hour_cals <- hour_cals %>% \n","  mutate(ActivityHour = mdy_hms(ActivityHour), Id = as.factor(Id)) %>%  clean_names()"]},{"cell_type":"code","execution_count":5,"id":"85d56618","metadata":{"_cell_guid":"a12fd60a-678b-4092-b3e0-bb5fc48dca0d","_uuid":"299e60b8-58d8-4108-b189-decdb2088a64","collapsed":false,"execution":{"iopub.execute_input":"2022-02-23T17:31:01.296614Z","iopub.status.busy":"2022-02-23T17:31:01.294623Z","iopub.status.idle":"2022-02-23T17:31:01.32474Z","shell.execute_reply":"2022-02-23T17:31:01.323454Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.309819,"end_time":"2022-02-23T17:31:01.324936","exception":false,"start_time":"2022-02-23T17:31:01.015117","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["Rows: 22,099\n","Columns: 3\n","$ id            \u001b[3m\u001b[90m<fct>\u001b[39m\u001b[23m 1503960366, 1503960366, 1503960366, 1503960366, 15039603…\n","$ activity_hour \u001b[3m\u001b[90m<dttm>\u001b[39m\u001b[23m 2016-04-12 00:00:00, 2016-04-12 01:00:00, 2016-04-12 02…\n","$ calories      \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m 81, 61, 59, 47, 48, 48, 48, 47, 68, 141, 99, 76, 73, 66,…\n","Rows: 1,325,580\n","Columns: 3\n","$ id              \u001b[3m\u001b[90m<fct>\u001b[39m\u001b[23m 1503960366, 1503960366, 1503960366, 1503960366, 150396…\n","$ activity_minute \u001b[3m\u001b[90m<dttm>\u001b[39m\u001b[23m 2016-04-12 00:00:00, 2016-04-12 00:01:00, 2016-04-12 …\n","$ calories        \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m 0.7865, 0.7865, 0.7865, 0.7865, 0.7865, 0.9438, 0.9438…\n"]}],"source":["#check that data is cleaned and properly formatted\n","glimpse(hour_cals)\n","\n","glimpse(min_cals)"]},{"cell_type":"markdown","id":"63dfb4b7","metadata":{"_cell_guid":"1207eef9-b6b7-469b-8eef-c26cd869c8ff","_uuid":"5afe27df-55f5-4926-bc41-8932f184a418","papermill":{"duration":0.295058,"end_time":"2022-02-23T17:31:01.913884","exception":false,"start_time":"2022-02-23T17:31:01.618826","status":"completed"},"tags":[]},"source":["Next, in the minute data, create a column referencing the time by hour and summarize the caloric sum per hour, grouped by id and hour of the day. The new dataframe named calc_calorie_hours should match the hourly dataset."]},{"cell_type":"code","execution_count":6,"id":"99c2d078","metadata":{"_cell_guid":"a37da411-9caa-447a-9c80-2516f87f12a6","_uuid":"4eb47eb0-dfcb-4917-838a-3ee43a9607b5","collapsed":false,"execution":{"iopub.execute_input":"2022-02-23T17:31:02.517114Z","iopub.status.busy":"2022-02-23T17:31:02.516268Z","iopub.status.idle":"2022-02-23T17:31:03.625793Z","shell.execute_reply":"2022-02-23T17:31:03.624172Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":1.410287,"end_time":"2022-02-23T17:31:03.625985","exception":false,"start_time":"2022-02-23T17:31:02.215698","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["`summarise()` has grouped output by 'id'. You can overr