ic output when looking at a linear line. Therefore, we can lightly state that sleeping more helps caloric output, or that caloric output helps sleep.\n","\n","Also, it appears most of the datapoints are around 7 hours, the red line in the plot. Getting 7 hours of sleep is generally considered a good night sleep for adults, but that depends on age. According to the Mayo Clinic's [FAQ page](https://www.mayoclinic.org/healthy-lifestyle/adult-health/expert-answers/how-many-hours-of-sleep-are-enough/faq-20057898), other factors include, but are not limited to: sleep quality, previous sleep deprivation, pregnancy, and aging.\n","\n","For the last plot, we can take a look at the average sleep hours by user."]},{"cell_type":"code","execution_count":56,"id":"d09166fc","metadata":{"execution":{"iopub.execute_input":"2022-02-23T17:32:28.627297Z","iopub.status.busy":"2022-02-23T17:32:28.625535Z","iopub.status.idle":"2022-02-23T17:32:28.647147Z","shell.execute_reply":"2022-02-23T17:32:28.645648Z"},"papermill":{"duration":0.442163,"end_time":"2022-02-23T17:32:28.647311","exception":false,"start_time":"2022-02-23T17:32:28.205148","status":"completed"},"tags":[]},"outputs":[],"source":["#create new dataframe with average sleep time\n","average_sleep <- daily_users_with_sleep %>% \n","  group_by(id) %>% \n","  summarize(mean_sleep = round(mean(total_minutes_asleep)/60, 1))"]},{"cell_type":"code","execution_count":57,"id":"a24e81a3","metadata":{"execution":{"iopub.execute_input":"2022-02-23T17:32:29.4851Z","iopub.status.busy":"2022-02-23T17:32:29.483537Z","iopub.status.idle":"2022-02-23T17:32:29.755342Z","shell.execute_reply":"2022-02-23T17:32:29.754721Z"},"papermill":{"duration":0.691233,"end_time":"2022-02-23T17:32:29.755478","exception":false,"start_time":"2022-02-23T17:32:29.064245","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ1wU5xYG8DNbgaU3sYAKoihYsGMXe7mKsaJRNCqKDRuoMUax