phic or sex\n","\n","**What days are they active?**\n","\n","-   33 active daily users\n","\n","-   In general, Tuesday, Wednesday, and Thursday are the most active,\n","    Saturday is 4th active day.\n","\n","-   Sunday, Monday and Friday are least active\n","\n","**What times are they active?**\n","\n","-   Midday and evenings on weekdays\n","-   Midday on Saturday\n","\n","**Do they track sleep?**\n","\n","-   15 of 33 users tracked their sleep\n","\n","    -   only 3 had data for 30 days\n","\n","<!-- -->\n","\n","-   Most users do not track sleep\n","\n","**Does getting more sleep improve caloric output?**\n","\n","-   There is a slight correlation between active days and sleep duration\n","\n","-   Majority of users get enough sleep, but not enough data to make any\n","    meaningful conclusions\n","\n","**Broad Issues**\n","\n","-   Not enough consistent data to draw meaningful conclusions\n","\n","-   Need more information about the users to give more context to their\n","    data\n","\n","## **Recommendations for Bellabeat Customers**\n","\n","-   Have users enter primary information upon using the Bellabeat app\n","\n","    -   Periodically, have users update that information. Ideally weekly to\n","        biweekly. Users can set that period for a reminder.\n","\n","-   Remind users to wear device to bed to track sleep\n","\n","    -   Possibly integrate with a standalone sleep tracking app or update\n","        current Bellabeat app to track sleep without an external device.\n","\n","-   Have users set reminders to be active on a consistent schedule\n","\n","    -   Time and location play a large factor in setting the stage for\n","        activity\n","\n","## **Recommendations for Marketing Strategy**\n","\n","It is said habits take 30 days to become ingrained. Start with a 6 week\n","free trial for new users, using just the app. After the trail, require a\n","subscription for premium features and include a discount for a wearable:\n","Leaf or Time.\n","\n","This will encourage new users to consistently use the app to track their\n","activity. By making a new habit, users will be more likely to continue\n","rather than try a different product or stop altogether."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":105.564982,"end_time":"2022-02-23T17:32:32.00239","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-02-23T17:30:46.437408","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}